//import './App.css';
import React from 'react'
import HeaderContainer from './components/header/HeaderContainer.tsx';
import Navbar from './components/navbar/Navbar.tsx';
import UsersPage from './components/users/UsersContainer.tsx';
import Login from './components/login/Login.tsx';
import {BrowserRouter,Route, Routes,Navigate, NavLink} from 'react-router-dom';
import {connect} from 'react-redux'
import {initializeApp} from './redux/app-reducer.ts'
import {compose} from 'redux'
import Preloader from './components/common/preloader/Preloader.tsx'
import store, { AppStateType } from './redux/redux-store.ts'
import {Provider} from 'react-redux';
import {Suspense} from 'react'
import 'antd/dist/reset.css';
import {
  DesktopOutlined,
  FileOutlined,
  PieChartOutlined,
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import { Avatar, Button, Col, MenuProps, Row } from 'antd';
import { Breadcrumb, Layout, Menu, theme } from 'antd';
import SubMenu from 'antd/es/menu/SubMenu';

const { Header, Content, Footer, Sider } = Layout;
const DialogsContainer = React.lazy(() => import('./components/dialogs/DialogsContainer.tsx'))
const ProfileContainer = React.lazy(() => import('./components/profile/ProfileContainer.tsx'))
type MenuItem = Required<MenuProps>['items'][number];
function getItem(
  label: React.ReactNode,
  key: React.Key,
  icon?: React.ReactNode,
  children?: MenuItem[],
): MenuItem {
  return {
    key,
    icon,
    children,
    label,
  } as MenuItem;
}

const items: MenuItem[] = [
  getItem('MyProfile', 'sub1', <TeamOutlined />, [
    getItem(<NavLink to='/profile'>Profile</NavLink>,"1"),
    getItem(<NavLink to='/dialogs'>Dialogs</NavLink>,"2"),
  ]),
  getItem('Developers', 'sub2', <TeamOutlined />, [
    getItem(<NavLink to='/users'>Find users</NavLink>,"3")
  ]),
  //getItem('Files', '9', <FileOutlined />),
];
type DispatchPropsType = {
  initializeApp:() => void
}
type MapPropsType = ReturnType<typeof mapStateToProps>

class App extends React.Component<DispatchPropsType & MapPropsType> {
  catchAllUnhandleErrors = (e: PromiseRejectionEvent) => {
    alert('Problem')
  }
  componentDidMount() {
    this.props.initializeApp();
    window.addEventListener("unhandledrejection",this.catchAllUnhandleErrors)
  }
  componentWillUnmount() {
    window.removeEventListener("unhandledrejection",this.catchAllUnhandleErrors)
  }
  render() {
    if(!this.props.initialized) {
      return <Preloader />
    }
    return (
    <Layout>
      <Header className="header">
        <div className="logo" />
        <Row>
          <Col span="20"><Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']} items={items}/></Col>
          <Col span="4"><Avatar style={{ backgroundColor: '#87d068' }} icon={<UserOutlined />} /></Col>
        </Row>

      </Header>
      <Content style={{ padding: '0 50px' }}>
        <Layout style={{ padding: '24px 0'}}>
          <Sider  width={200}>
            <Menu theme="dark"
              mode="inline"
              defaultSelectedKeys={['2']}
              defaultOpenKeys={['sub1']}
              style={{ height: '100%' }}
              items={items}
            />
          </Sider>
          <Content style={{ padding: '0 24px', minHeight: 280 }}>
          <Suspense fallback={<div><Preloader /></div>}>
            <Routes>
                <Route path='/' element={<Navigate to="/profile" />}/>
                <Route path='/profile/:userId?' element={<ProfileContainer h='Profile'/>}/>
                <Route path='/dialogs/*' element={<DialogsContainer h='Dialogs'/>}/>
                <Route path='/users' element={<UsersPage h='Users'/>}/>
                <Route path='/login' element={<Login h='Login'/>}/>
                <Route path='*' element={<div>404 NOT FOUND<Button type={"primary"}>OK</Button></div>}/>
          </Routes>
          </Suspense>
          </Content>
        </Layout>
      </Content>
    </Layout>

      /*<div >
        <header>
          <HeaderContainer />
        </header>
        <main>
          <Navbar /*sidebar={props.state.sidebarPage.sidebar}/>
          <Suspense fallback={<div><Preloader /></div>}>

          </Suspense>
        </main>
      </div>



                  <SubMenu key="sub1" title="My Profile">
              <Menu.Item key="1">                
                <NavLink to='/profile' className = { navData => navData.isActive ? s.active : s.item }>Profile</NavLink>
              </Menu.Item>
              <Menu.Item key="2">                
              <NavLink to='/dialogs' className = { navData => navData.isActive ? s.active : s.item }>Messages</NavLink>
              </Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" title="Developers">
              <Menu.Item key="3">                
                <NavLink to='/users' className = { navData => navData.isActive ? s.active : s.item }>Find users</NavLink>
              </Menu.Item>
            </SubMenu>*/
    );
}
}

const mapStateToProps = (state:AppStateType) => ({
  initialized:state.app.initialized
})
let AppContainer = compose<React.ComponentType>(
  connect(mapStateToProps,{initializeApp}),
)(App);

let AppMain:React.FC = () => { 
  return <BrowserRouter>
  <Provider store={store}>
    <AppContainer />
  </Provider>
</BrowserRouter>
}

export default AppMain
